import { ThemeProvider } from "styled-components";
import { RFPercentage, RFValue } from "react-native-responsive-fontsize";

export const theme = {
  colors: {
    main_color: "#112D4E",
    blue_color: "#3F72AF",
    gray_color: "#F9F7F7",
    white_color: "#ffff",
    orange_color: "#F07B3F",
    yellow_color: "#FFD460",
    black_color: "#050505",
  },

  fonts: {
    font_color: "#fff",
    font_main_color: "#2D4059",
    fontLogo: "'Helvetica', sans-serif",
    fontExtra: "100px",
    fontLarge: "48px",
    fontMediumLarge: "40px",
    fontMedium: "28px",
    fontSemiMedium: "20px",
    fontRegular: "18px",
    fontSmall: "16px",
    fontMicro: "14px",

    weightExtra: 800,
    weightBold: 700,
    weightSemiBold: 600,
    weightSemiRegular: 500,
    weightRegular: 400,
  },

  styles: StyleSheet.create({
    welcome: {
      fontSize: RFValue(24, 580), // second argument is standardScreenHeight(optional),

      margin: 10,
    },
  }),
};
